import React from 'react';

const SideBar = ({ apparatusList, addItemToWorkspace }) => {
  return (
    <div className="sidebar">
      <h3>Apparatus</h3>
      {apparatusList.map((apparatus) => (
        <div key={apparatus.id} className="sidebar-item">
          <span>{apparatus.name}</span>
          <button onClick={() => addItemToWorkspace(apparatus)}>Add to Workspace</button>
        </div>
      ))}
    </div>
  );
};

export default SideBar;
